//login
import {post} from "@/utils/http";

export function login(username, passwd) {
    post("/user/login", {
        createTime: "",
        id: 0,
        password: passwd,
        permissions: 0,
        updateTime: "",
        username: username
    }).then(res => {
        console.log(res);
    }).catch(err => {
        console.log(err);
    })
}
